export function converter(value, led)
{
    let bin = 100000111;
    if(value != 0)
    {
        bin += 10000000
    }
    if(led == 2 || led == 4)
    {
        bin += 100000
    }
    if( led == 3 || led == 4)
    {
        bin += 1000000
    }
    if(value == 50 || value == 100)
    {
        bin += 1000
    }
    if( value == 75 || value == 100)
    {
        bin += 10000
    }



}
